import React, { Component } from 'react';
import { Link } from 'react-router-dom';
import M from "materialize-css";
import nav_logo from '../assets/images/nav_logo.png';

class Navbar extends Component {

  componentDidMount() {
    M.AutoInit();
  }

  render(){
    return (
      <div>
        <nav className="navbar-fixed red">
          <div className="nav-wrapper">
          <img class="brand-logo responsive-img left" src={nav_logo} style={{padding:"10px"}} />
            <a href="#" data-target="mobile-demo" className="show-on-small-only sidenav-trigger right"><i className="material-icons">menu</i></a>
            <ul className="right hide-on-small-only">
              <li><Link to='/'>HOME</Link></li>
              <li><Link to='/#'>FEATURES</Link></li>
              <li><Link to='/#'>NEWS</Link></li>
              <li><Link to='/#'>BUY NOW</Link></li>
            </ul>
          </div>
        </nav>
        <ul className="right sidenav" id="mobile-demo">
          <li><Link to='/'>HOME</Link></li>
          <li><Link to='/#'>FEATURES</Link></li>
          <li><Link to='/#'>NEWS</Link></li>
          <li><Link to='/#'>BUY NOW</Link></li>
        </ul>
      </div>
    );
  }
}

export default Navbar;
